

-- 1. On fixe le style de date pour quil ny ait pas de surprise
SET datestyle = 'ISO, DMY';

-- 2. Mise  jour alatoire de end_date
UPDATE AccountRestriction
SET    end_date =
       start_date
       + (                              -- on additionne N jours
           1                            -- au moins 1 jour
           + floor(                     -- plus un nombre entier alatoire
               random()                 --   entre 0 et 1  (flottant)
               *                        --   tendu  :
               GREATEST(                --   - si start_date proche de 2030-01-01,
                   1,                   --     on garde au moins 1 jour de marge
                   (DATE '2030-01-01' - start_date - 1)
                 )
             )
         )::int                         -- on cast en entier
WHERE  end_date IS NULL;
